import Link from 'next/link';
import authContext from '../context/auth/authContext';
import appContext from '../context/app/appContext';
import { useRouter } from 'next/router';


const Footer = () => {

    return ( 
        <footer className="grid grid-cols-1 text-center py-8">
            <p className="text-gray-800 text-sm">Alkemy Challenge JS</p>
            <p className="text-gray-800 text-sm">Joan Manuel Defelippe</p>
        </footer>
     );
}
 
export default Footer;
